import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import Sdata from './Sdata'; 


function ncard(val){
    return(
        <Card 
    imgsrc={val.imgscr}
    title={val.title}
    sname={val.sname}
    link={val.link}
    />

    )

}

ReactDOM.render(
    <>
    <h1 className='heading_style'> List Of Top 5 Netflix Series In 2020 </h1>
    {Sdata.map(ncard)}

    </>,
    document.getElementById("root")
);
